import React, { useContext, useRef, useEffect } from 'react';
import { StyleSheet, View } from 'react-native';
import { useHistory } from 'react-router-native';
import { SignInWithGoogle } from '../firebase/firebaseFunctions';
import Button from './Button';

const styles = StyleSheet.create({
  container: {
    flexDirection: 'column',
    top: 10,
    zIndex: 1000,
  },
  button: {
    marginBottom: 10
  }
});


const SignInPage = () => {

const history = useHistory();

const submitSignInWithGoogle = () => {
    SignInWithGoogle();
    history.push('/');
};



  return (
    <>
       <View style={styles.container}>
        <Button onPress={submitSignInWithGoogle} style={styles.button}>
            Sign up with google
        </Button>
        <Button onPress={() => {history.push("/sign-up-email");}} style={styles.button}>
            Sign up with Email
        </Button>
       </View>
    </>

  );
};

export default SignInPage;
